      SELECT DISTINCT * FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT - 84 BETWEEN + 24 + + 83 + + col1 + - 66 AND 22 + - col1 * + col1;
  - name: tab2

outputs:
